import React from 'react'
import placeLogo from '../images/place.png'

function Main(props){
    return (
        <div className='card-elements'>
            <img src={props.item.imageUrl} alt="TravelPic"/>
            <div>
                <img src={placeLogo} alt="PlaceIcon"/>
            </div>
        </div>
    )
}

export default Main
